import * as React from "react";

const Index = () => <h1>Hello world!My Name is Kun Ho</h1>;

Home.getInitialProps = async ({ req }: any) => {
    const userAgent = req ? req.headers['user-agent'] : navigator.userAgent;
    return { userAgent };
};

export default Home;
